function getScreenshotTexture()
{
    cc.director.setNextDeltaTimeZero(true);
    var renderTexture = new cc.RenderTexture(cc.winSize.width, cc.winSize.height);
    renderTexture.begin();
    this.visit();
    renderTexture.end();
    return renderTexture.getSprite().getTexture();
}

function screenshot (node, winSize, fileName) {
    if(!cc.sys.isNative) return;

    var tex = new cc.RenderTexture(node.getContentSize().width, node.getContentSize().height, cc.Texture2D.PIXEL_FORMAT_RGBA8888);
    
    tex.x = 0;
    tex.y = 0;
    tex.begin();
    node.visit();
    tex.end();

    if(cc.sys.isNative) {
        var imgPath = jsb.fileUtils.getWritablePath();
    } else {
        var imgPath = "";
    }
    if (imgPath.length == 0) {
        return;
    }
    var result = tex.saveToFile(fileName, cc.IMAGE_FORMAT_PNG);
    if (result) {
        imgPath += fileName;
        cc.log("save image:" + imgPath);
        return imgPath;
    }
    return "";
}

