function isLockPack(pack){
    if(pack <= rms.getItem(KEY_UNLOCK_PACK, UNLOCK_PACK_DEFAULT)) return false;
    for(var iPack = 1; iPack < pack; iPack++){
        var unlockedLevel = rms.getItem(KEY_UNLOCK_LEVEL + iPack + "_" + g_pack_sub, UNLOCK_DEFAULT);
        if(unlockedLevel < g_pack_num[iPack]) return true;
    }
    return false;
}

function showMessage(title, message) {
    if (cc.sys.os == cc.sys.OS_ANDROID) {
        jsb.reflection.callStaticMethod("org/cocos2dx/javascript/AppActivity", "showMessage", "(Ljava/lang/String;Ljava/lang/String;)V", title, message);
    }
}

