function requestInviteFbWithIds(){
	cc.log("requestInviteFbWithIds");
	if(sdkbox.PluginFacebook.isLoggedIn()){
		var params = new Object();
		params.fields = "name,id";
		params.limit = 50;
		sdkbox.PluginFacebook.api("/me/invitable_friends", "GET", params, "/me/invitable_friends");
	} else {
		sdkbox.PluginFacebook.login(["user_friends"]);
	}
}